import React, {useState} from "react";
import './register.css';
import img from '../assets/reg_user.svg'
const Register = () => {

    const [selectedOption, setSelectedOption] = useState('');
    const [selectedOption2, setSelectedOption2] = useState('');

    // Function to handle the option change
    const handleOptionChange = (e) => {
        setSelectedOption(e.target.value);
    };

    const handleOptionChange2 = (e) => {
        setSelectedOption2(e.target.value);
    };

    return (
        <div className="grid md:grid-cols-2 sm:grid-cols-1">
            <div className="">
                <img src={img} className="w-[700px]"/>
            </div>
            <div className="">
                <form className="bg-white order-2 border border-white mx-20 rounded-md">
                    <h2 className="text-[#1896b9] py-3 mt-[30px] mb-[30px] display-flex justify-center text-center text-4xl font-bold">
                        Register
                    </h2>

                    <div className="">
                        <label className="text-gray-600 w-[10%] py-0 my-0 text-lg">Email</label>
                        <input className="border border-gray-200 focus:border-[#1896b9] py-5 px-3 my-0 rounded-md w-[80%]" type="text" placeholder="Enter email" />
                    </div>


                    <div className="my-5">
                        <label className="text-gray-600 py-0 my-0 w-[15%] text-lg">Password</label>
                        <input className="border border-gray-200 focus:border-[#1896b9] py-5 px-3 my-0 rounded-md w-[80%]" type="password" placeholder="Enter password" />
                    </div>

                    <div className="my-5">
                        <label className="text-gray-600 py-0 my-0 w-[29%] text-lg"> Re-Enter Password</label>
                        <input className="border border-gray-200 focus:border-[#1896b9] py-5 my-0 w-[80%]" type="password" placeholder="Re-Enter password" />
                    </div>

                    <div className="grid grid-cols-2 w-[100%] my-[-15px]">
                        <div className="my-5">
                            <label className="text-gray-600 py-0 my-0 text-lg w-[43%]"> Select School </label>
                            <select className="border border-gray-200 ml-[55px] w-[80%] py-2 rounded-md flex justify-content mx-auto px-2" id="country" value={selectedOption} onChange={handleOptionChange}>
                                <option value="">Select a school</option>
                                <option value="i">Individual</option>
                                <option value="qc">Queen's College</option>
                                <option value="ka">Kingsway Academy</option>
                                <option value="sac">St. Augustine's College</option>
                                <option value="sta">St. Andrew's School</option>
                                <option value="gen">Genesis Academy</option>
                            </select>
                        </div>

                        <div className="my-5">
                            <label className="text-gray-600 py-0 my-0 text-lg w-[100%] ml-[0px]"> Role </label>
                            <select className="border border-gray-200 ml-[90px] py-2 rounded-md flex justify-content mx-auto px-2" id="country" value={selectedOption2} onChange={handleOptionChange2}>
                                <option value="">Select a role</option>
                                <option value="student">Student</option>
                                <option value="teacher">Teacher</option>
                            </select>
                        </div>
                    </div>

                    <button className="bg-[#1896b9] hover:bg-[#1896b980] my-10 mt-30"> Register Now </button>
                </form>
            </div>
        </div>
        // <div className=" w-full-[1240px] py-16 text-white px-4 bg-yellow-600">
        //     <div className="max-w-screen-xl mx-auto grid lg:grid-cols-3 bg-white py-10 ">
        //         <div className="lg:col-span-2 py-2 px-4 bg-blue-600">
        //             <h1>PICTURE</h1>
        //         </div>
        //         <div className="bg-red-600 py-2 px-4">
        //             <h1> LOGIN FORM </h1>
        //         </div>
        //     </div>
        // </div>
    );
};

export default Register;
